    "def convert_to_float(value):\n",
    "    if isinstance(value, str):\n",
    "        value = value.replace(',', '')  # Remove any commas\n",
    "        if 'M' in value:\n",
    "            return float(value.replace('M', '')) * 1_000_000\n",
    "        elif 'K' in value:\n",
    "            return float(value.replace('K', '')) * 1_000\n",
