    "# PACF plot\n",
    "plot_pacf(df['log_price'].dropna(), lags=40, ax=axes[1], method='ywm')\n",
    "axes[1].set_title('Partial Autocorrelation Function (PACF) for Log Price')\n",
    "\n",
